  false,\n\t\"url\": null,\n\t\"notes\": \"As part of several inter-agency agreements
  between the National Marine Mammal Laboratory (NMML) and the Bureau of Ocean Energy
  Management (BOEM), visual surveys of the Bering, Chukchi, and Western Beaufort Seas
  were conducted within the months of July to September every year starting in 2010.
  Visual surveys were used to document distribution of marine mammals, with specific
  focus on cetacean species. Since 2010, 9 cetacean species and a total of 17 marine
  mammal species were documented.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
